  def getAsnBeanAsJSON(row: Array[Byte]) ={
    var asnResponse:String=""
    val x = row
    var parseRec: RrcOtaMessageParse = new RrcOtaMessageParse
    parseRec.parse(x, true)
    var jsonObject:JSONObject  = parseRec.getBean
    if(jsonObject!=null) asnResponse = jsonObject.toString
    //logger.info("Json for ASN Dynamic : {}",asnResponse);
    asnResponse
  }

