  def getNasBeanAsJSON(row: Array[Byte], logCode:Int) ={
    var nasResponse:String = ""
    val x = row
    var parseRec : NasRowParser = new NasRowParser;
    var jsonObject:JSONObject = parseRec.parseAsJson(row, logCode)
    if(jsonObject!=null) nasResponse = jsonObject.toString
    nasResponse
  }

  def getSipBeanAsJSON(row: Array[Byte], pkt_13:Int) = {
    var sipResponse:String = ""
    var parseRec:SipHeader = null
    if(pkt_13==0){
      parseRec = new SipHeader(row,IpDirection.OUTGOING)
    } else if(pkt_13==1){
      parseRec = new SipHeader(row,IpDirection.INCOMING)
    } else{
      parseRec = new SipHeader(row,IpDirection.UNKNOWN)
    }
    if(parseRec!=null){
      parseRec.parseHeader
      var jsonObject:JSONObject  = parseRec.getBean
      if(jsonObject != null) sipResponse = jsonObject.toString
    }
    else{
      logger.error("Unable to parse SIP Bean. Packet[13] info : "+pkt_13.toString)
    }
    //logger.info("SIP JSON ==>"+sipResponse)
    sipResponse
  }

  def getRtpBeanAsJSON(row: Array[Byte], pkt_13: Int) = {
    var rtpResponse: String = ""
    //var parseRec: RtpHeader = null
    var parseRec: IPv6Header = null

    if (pkt_13 == 0) {
      parseRec = new IPv6Header(row, IpDirection.OUTGOING, true)
      //parseRec = new RtpHeader(row, IpDirection.OUTGOING)
    } else if (pkt_13 == 1) {
      parseRec = new IPv6Header(row, IpDirection.INCOMING, true)
      //parseRec = new RtpHeader(row, IpDirection.INCOMING)
    } else {
      parseRec = new IPv6Header(row, IpDirection.UNKNOWN, true)
      //parseRec = new RtpHeader(row, IpDirection.UNKNOWN)
    }

    if (parseRec != null) {
      parseRec.parseHeader
      var jsonObject: JSONObject = parseRec.getBean
      if (jsonObject != null) rtpResponse = jsonObject.toString
    }
    else {
      logger.error("Unable to parse RTP Bean. Packet[13] info : " + pkt_13.toString)
    }

    //logger.info("RTP JSON ==>"+rtpResponse)
    rtpResponse
  }

  def getCustomLogPacketAsJSON(row: Array[Byte], logCode:Int) ={
    var clpResponse:String = ""
    val x = row
    var jsonObject:JSONObject = null
    logCode match {
      case 0xFFF1 =>
        var parseRec:VoLTESummary = new VoLTESummary
        parseRec.parse(row)
        jsonObject  = parseRec.getBean
      case 0xFFF5 =>
        var parseRec:InbuildingInfo = new InbuildingInfo
        parseRec.parse(row)
        jsonObject  = parseRec.getBean
      case 0xFFFA =>
        var parseRec:WifiInfo = new WifiInfo
        parseRec.parse(row)
        jsonObject  = parseRec.getBean
      case 0xFFFB =>
        var parseRec:DeviceInfo = new DeviceInfo
        parseRec.parse(row)
        jsonObject  = parseRec.getBean
      case 0xFFFF =>
        var parseRec:Location = new Location
        parseRec.parse(row)
        jsonObject  = parseRec.getBean
    }
    if(jsonObject!=null) clpResponse = jsonObject.toString
    clpResponse
  }

  def getJsonValueByKey(jsonStr:String, jsonColName:String) = {
    (parse(jsonStr) \\ jsonColName).values.getOrElse(jsonColName, "").toString
  }

  def getSubJsonValueByKey(jsonStr: String, jsonColName: String) = {
    var response : String = ""

    val out = (parse(jsonStr) \\ jsonColName).values.getOrElse(jsonColName, null)
    if(out != null) {
      response = compactRender(Extraction.decompose(out)(net.liftweb.json.DefaultFormats))
    }
    response
  }


  def checkNr_releaseExistsInPayload(jsonStr: String, jsonColName: String) :Boolean= {
    (parse(jsonStr) \\ jsonColName).has(jsonColName)
  }

  implicit class JValueExtended(value: JValue) {
    def has(childString: String): Boolean = {
      if ((value \ childString) != JNothing) {
        true
      } else {
        false
      }
    }
  }

  def getAdbMsgBeanAsJSON(row: Array[Byte]) = {
    var adbMsgResponse:String=""
    val x = row
    var parseRec: ADBMessageParse = new ADBMessageParse
    try{
      parseRec.parse(x, true)
      var jsonObject:JSONObject  = parseRec.getBean
      if(jsonObject!=null) adbMsgResponse = jsonObject.toString
    }catch {
      case ae:ArrayIndexOutOfBoundsException =>
        logger.info("Sequence Job : ArrayIndexOutOfBoundsException Occurred while Parsing RM Test Info : "+ae.getCause)
      case iae:IllegalArgumentException =>
        logger.info("Sequence Job : IllegalArgumentException Occurred while Parsing RM Test Info : "+iae.getCause)
      case ge:Exception =>
        logger.info("Sequence Job : General Exception Occurred while Parsing RM Test Info : "+ge.getCause)
    }
    //logger.info("Json for ADB Msg Dynamic : {}",adbMsgResponse);
    adbMsgResponse
  }

